  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route path="/linkPage" component={LinkPage}/>
        <Route path="/courses" component={Course}/>
        <Route path="/about" component={About} />

      </Switch>
      <Footer/>

    </BrowserRouter>
  );
};

export default App;
